// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./ERC721r.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

interface IHValue {
    function balanceOf(address account, uint256 id)
        external
        view
        returns (uint256);

    function safeTransferFrom(
        address from,
        address to,
        uint256 id,
        uint256 amount,
        bytes calldata data
    ) external;

    function burn(
        address from,
        uint256 tokenId,
        uint256 amount
    ) external;
}

contract HashPunk is ERC721r, Ownable {

    uint256 public constant passId = 1;
    uint256 public          passIdBase;
    uint256 public          base;
    IHValue public          hValue;
    string  private         _baseMetadataURI;

    constructor(
        string memory _uri,
        address _hValue,
        uint256 _base,
        uint256 _passIdBase
    ) ERC721r("HashPunk", "HP", 3000) {
        passIdBase = _passIdBase;
        base = _base;
        hValue = IHValue(_hValue);
        _baseMetadataURI = _uri;
    }

    function mint(address to, uint256 id, uint256 amout) public {
        if (id == passId) {
            require(hValue.balanceOf(msg.sender, passId) >= passIdBase, "insufficient Pass Card balance");
            hValue.burn(msg.sender, passId, passIdBase);
            _mintRandom(to, amout);
            return;
        }
        require(hValue.balanceOf(msg.sender, id) >= base, "insufficient H balance");
        hValue.burn(msg.sender, id, base);
        _mintRandom(to, amout);
    }

    /**
     * Sets a new baseURI for NFT.
     */
    function setBaseUri(string memory baseUri) external onlyOwner {
        _baseMetadataURI = baseUri;
    }

    /**
     * @dev See {IERC721Metadata-tokenURI}.
     */
    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override
        returns (string memory)
    {
        require(tokenId <= totalSupply(), "NFT does not exist");
        return string(abi.encodePacked(_baseMetadataURI, _uint2str(tokenId)));
    }

    function setPassIdBase(uint256 _passIdBase) public onlyOwner {
        passIdBase = _passIdBase;
    }

    function setBase(uint256 _base) public onlyOwner {
        base = _base;
    }

    function setHValue(IHValue _hValue) public onlyOwner {
        hValue = _hValue;
    }

    function _uint2str(uint256 _i) internal pure returns (string memory) {
        if (_i == 0) {
            return "0";
        }
        uint256 j = _i;
        uint256 len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bStr = new bytes(len);
        uint256 k = len;
        while (_i != 0) {
            k = k - 1;
            uint8 temp = (48 + uint8(_i - (_i / 10) * 10));
            bytes1 b1 = bytes1(temp);
            bStr[k] = b1;
            _i /= 10;
        }
        return string(bStr);
    }
}

